//importing packages 
import supertest from "supertest"
import config from "../config"
import chai from "chai"
import { expect } from "chai"
import jsonschema from "../test_data/jsonschema/postusers.json"
import jsonschema1 from "../test_data/jsonschema/getusers.json"
import jsonschema2 from "../test_data/jsonschema/putusers.json"

chai.use(require('chai-json-schema'));

//variables
const url = supertest(config.baseurl);

describe('POST/users', () => {
    it('POST/create details in page', async() => {
       const response = await url.post(config.postuser)
       .type('application/json')
       .send ({
        "name": "morpheus",
        "job": "leader"
    
       }) 
       .expect(201)
       .expect((res) => {
           //console.log(res)
        expect(res.body).to.be.jsonSchema(jsonschema.valid_schema)
        })
    });

    it('GET/get details in id', async() => {
        const response = await url.get(config.getuser)
     
        .expect(200)
        .expect((res) => {
           // console.log(res)
         expect(res.body).to.be.jsonSchema(jsonschema1.valid_schema)
         })
    });
    
    
    it('PUT/update details in id', async() => {
        const response = await url.put(config.putuser)
        .type('application/json')
        .send ({
            "name": "morpheus",
            "job": "zion resident"
        })
        
        .expect(200)
        .expect((res) => {
           // console.log(res)
         expect(res.body).to.be.jsonSchema(jsonschema2.valid_schema)
         })
    }); 
});

